#ifdef _WIN32
#include <windows.h>
#endif // _WIN32

#include <GL/gl.h>

#include <ErrorManager.h>
#include <MyGLH.h>
#include <MyMath.h>

#include "MyTree.h"

using namespace std;

/**
*/
CMyTree::CMyTree(void)
{
	Create();
}

/**
*/
CMyTree::~CMyTree(void)
{
}

/**
*/
bool CMyTree::Initialize(void)
{
	if (!InitializeMesh())
	{
		MarkError();

		return false;
	}

	if (!InitializeTexture())
	{
		MarkError();

		return false;
	}

	return true;
}

/**
*/
void CMyTree::LoadDrawState(void)
{
	glColor3f(1.0f, 1.0f, 1.0f);

	glAlphaFunc(GL_GREATER, 0.1f);

	glEnable(GL_ALPHA_TEST);

	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);

	//glEnable(GL_BLEND);
}

/**
*/
void CMyTree::UnloadDrawState(void)
{
	//glDisable(GL_BLEND);

	glDisable(GL_ALPHA_TEST);
}

/**
*/
void CMyTree::Draw(void) 
{
	LoadDrawState();

	m_texture->Bind(0);

	m_mesh->Draw();

	CTexture::DisableTextureUnit(0);

	UnloadDrawState();
}

/**
*/
boost::shared_ptr<CVertexPool> CMyTree::GetMesh(void)
{
	return m_mesh;
}

/**
*/
boost::shared_ptr<CTexture> CMyTree::GetTexture(void)
{
	return m_texture;
}

/**
*/
bool CMyTree::IsValid(void) 
{
	if (m_texture.get())
		if (m_texture->IsValid())
			if (m_mesh.get())
				if (m_mesh->IsValid())
					return true;

	return false;
}

/**
*/
bool CMyTree::InitializeMesh(void)
{
	float billboardAngle,
		billboardLeftBottomPoint[3],
		billboardRightBottomPoint[3],
		billboardNormal[3],
		billboardMinHorizontalTexCoord,
		billboardMaxHorizontalTexCoord;
	int i;

	m_mesh.reset(new CVertexPool);

	if (!m_mesh.get())
	{
		MarkError();

		return false;
	}

	for (i=0; i<3; i++)
	{
		billboardAngle = float(i)*120.0f*0.0174533f;

		billboardLeftBottomPoint[0] = cos(billboardAngle);
		billboardLeftBottomPoint[1] = 0.0f;
		billboardLeftBottomPoint[2] = sin(billboardAngle);

		billboardRightBottomPoint[0] = -billboardLeftBottomPoint[0];
		billboardRightBottomPoint[1] = 0.0f;
		billboardRightBottomPoint[2] = -billboardLeftBottomPoint[2];

		billboardNormal[0] = -billboardLeftBottomPoint[2];
		billboardNormal[1] = 0.0f;
		billboardNormal[2] = billboardLeftBottomPoint[0];

		billboardMinHorizontalTexCoord = 0.0f;
		billboardMaxHorizontalTexCoord = 0.4f;

		m_mesh->AddTexCoord(billboardMinHorizontalTexCoord, 1.0f);
		m_mesh->AddVertex((1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[0]) - 0.95f*billboardNormal[0], (1.0f - billboardMinHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMinHorizontalTexCoord*billboardRightBottomPoint[1], (1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[2]) - 0.95f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMaxHorizontalTexCoord, 1.0f);
		m_mesh->AddVertex((1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMaxHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMaxHorizontalTexCoord*billboardRightBottomPoint[1], (1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMaxHorizontalTexCoord, 0.0f);
		m_mesh->AddVertex((1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMaxHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMaxHorizontalTexCoord*billboardRightBottomPoint[1] + 3.0f, (1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMinHorizontalTexCoord, 0.0f);
		m_mesh->AddVertex((1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[0]) - 0.95f*billboardNormal[0], (1.0f - billboardMinHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMinHorizontalTexCoord*billboardRightBottomPoint[1] + 3.0f, (1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[2]) - 0.95f*billboardNormal[2]);
		
		m_mesh->AddQuad(i*12 + 0, i*12 + 1, i*12 + 2, i*12 + 3);

		billboardMinHorizontalTexCoord = 0.4f;
		billboardMaxHorizontalTexCoord = 0.6f;

		m_mesh->AddTexCoord(billboardMinHorizontalTexCoord, 1.0f);
		m_mesh->AddVertex((1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMinHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMinHorizontalTexCoord*billboardRightBottomPoint[1], (1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMaxHorizontalTexCoord, 1.0f);
		m_mesh->AddVertex((1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMaxHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMaxHorizontalTexCoord*billboardRightBottomPoint[1], (1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMaxHorizontalTexCoord, 0.0f);
		m_mesh->AddVertex((1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMaxHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMaxHorizontalTexCoord*billboardRightBottomPoint[1] + 3.0f, (1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMinHorizontalTexCoord, 0.0f);
		m_mesh->AddVertex((1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMinHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMinHorizontalTexCoord*billboardRightBottomPoint[1] + 3.0f, (1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		
		m_mesh->AddQuad(i*12 + 4, i*12 + 5, i*12 + 6, i*12 + 7);

		billboardMinHorizontalTexCoord = 0.6f;
		billboardMaxHorizontalTexCoord = 1.0f;

		m_mesh->AddTexCoord(billboardMinHorizontalTexCoord, 1.0f);
		m_mesh->AddVertex((1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMinHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMinHorizontalTexCoord*billboardRightBottomPoint[1], (1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMaxHorizontalTexCoord, 1.0f);
		m_mesh->AddVertex((1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[0]) - 0.95f*billboardNormal[0], (1.0f - billboardMaxHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMaxHorizontalTexCoord*billboardRightBottomPoint[1], (1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[2]) - 0.95f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMaxHorizontalTexCoord, 0.0f);
		m_mesh->AddVertex((1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[0]) - 0.95f*billboardNormal[0], (1.0f - billboardMaxHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMaxHorizontalTexCoord*billboardRightBottomPoint[1] + 3.0f, (1.0f - billboardMaxHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMaxHorizontalTexCoord*(billboardRightBottomPoint[2]) - 0.95f*billboardNormal[2]);
		m_mesh->AddTexCoord(billboardMinHorizontalTexCoord, 0.0f);
		m_mesh->AddVertex((1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[0]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[0])- 0.2f*billboardNormal[0], (1.0f - billboardMinHorizontalTexCoord)*billboardLeftBottomPoint[1] + billboardMinHorizontalTexCoord*billboardRightBottomPoint[1] + 3.0f, (1.0f - billboardMinHorizontalTexCoord)*(billboardLeftBottomPoint[2]) + billboardMinHorizontalTexCoord*(billboardRightBottomPoint[2])- 0.2f*billboardNormal[2]);
		
		m_mesh->AddQuad(i*12 + 8, i*12 + 9, i*12 + 10, i*12 + 11);
	}
	
	if (!m_mesh->IsValid())
	{
		MarkError();

		return false;
	}

	return true;
}

